import './App.css';
import {BrowserRouter, Routes, Route, Link} from 'react-router-dom';

const App = () => {

  const openIOH = (e) => {
      e.preventDefault();
      window.location.href('https://in-our-hands.com/');
  }

  return (
    <BrowserRouter>
    <Routes>
    <div className="container">
        <h1> Hello World! </h1>
        <h2> We are travelling by car back from the farm.</h2>
        <Route path="/in-our-hands">
          <Link to="/in-our-hands">
            <button onClick={openIOH}> In Our Hands</button>
          </Link>
        </Route>
    </div>
    </Routes>
    </BrowserRouter>
  )
}

export default App;
